import GridLayout from "react-grid-layout";

function App(params) {
	const layout = [
		{ i: "a", x: 0, y: 0, w: 1, h: 2, static: true },
		{ i: "b", x: 1, y: 1, w: 12, h: 8, minW: 2, maxW: 12},
		{ i: "c", x: 4, y: 0, w: 1, h: 2 }
	  ];
	  return (
		<GridLayout
		  className="layout"
		  layout={layout}
		  cols={12}
		  rowHeight={30}
		  width={1200}
		>
		  <div key="a" className="border"></div>
		  <div key="b" className="border">b</div>
		  <div key="c">c</div>
		</GridLayout>
	  );
}
export default App;
